[[include :scp-wiki:theme:minimal]]

[[module css]]
#page-title {
  display: none;
}

#header {
    background: url(https://upload.wikimedia.org/wikipedia/commons/1/13/U%2B25CF.svg) 10px 40px no-repeat;
}

#header h1 a::before, #header h2 span::before { content: "";}

html {
   -webkit-filter: grayscale(1); /* Older Webkit */
  -webkit-filter: grayscale(100%);
  -moz-filter: grayscale(100%);
  -ms-filter: grayscale(100%);
  -o-filter: grayscale(100%);
  filter: grayscale(100%);
}
[[/module]]

